function TopBanner() {
  return (
    <>
      <div className="row">
        <div className="col-2">
          <img src="./JoelHiltonHeadshot.jpg" alt="Joel Hilton" />
        </div>
        <div className="col align-self-center text-start">
          <h1>The Joel Hilton Film Collection</h1>
        </div>
      </div>
    </>
  );
}

export default TopBanner;
